import { Box, Center, Grid, Text } from "@mantine/core";
import React from "react";

// Function that generates the lime-colored box JSX structure
const createLimeBox = (text) => (
  <Box bg="lime.5" style={{ borderRadius: "10px", cursor: "pointer" }}>
    <Center>
      <Text>{text}</Text>
    </Center>
  </Box>
);

const Layout3 = () => {
  const items = ["Item 1", "Item 2", "Item 3"];

  return (
    <Box bg="gray.4" h={200} style={{ borderRadius: "10px" }}>
      <Grid.Col span={12}>
        {createLimeBox("Test")}
      </Grid.Col>
      <Grid ml="xs" mr="xs">
        {items.map((item, index) => (
          <Grid.Col key={index} span={4}>
            <Box
              bg="blue.1"
              h={60}
              style={{ border: "1px solid #000000", cursor: "pointer" }}
            >
              <Center>{item}</Center>
            </Box>
          </Grid.Col>
        ))}
      </Grid>
    </Box>
  );
}

export default Layout3;
